@bhailog: As far as I can tell - no torrent of Journeyman is alive.
I use 720p versions and whole season (13x1.09GB) is probably too big for you.
After ten seconds of search on "Google" the term "Journeyman DVDrip" on first page I get page of ddlhere.com with working links for direct download. So, get jdownloader and run there (or someplace else if Google shows better links).
